        </div>
        <div className="item">
          <img src="assets/cat.jpg" alt="" />
          <h3>Banking app</h3>
        </div>
        <div className="item">
          <img src="assets/cat.jpg" alt="" />
          <h3>Banking app</h3>
        </div>
      </div>

    </div>
  )
}
